function populateTable(numberOfRows) {
    for (let i = 0; i < numberOfRows; i++) {
        let rowElement = document.createElement('tr');
        rowElement.id = 'row' + i;
        rowElement.setAttribute('data-sound', 'true');
        populateTableRows(rowElement, false);
    }
}

function populateTableRows(newRow, isRefresh) {
    for (let i = 0; i < 5; i++) {
        let newCell = document.createElement('td');
        switch (i) {
            case 0:
                newCell.innerHTML = provincesSelectTemplate;
                newCell.firstElementChild.addEventListener('change', (e) => {
                    if (assistant !== null) {
                        assistant.play('Searching', 5000);
                        assistantProvinceHandler();
                        setTimeout(function () {
                            populateProcedureSelect(e.target.value, newRow.id);
                        }, 500);
                    } else {
                        populateProcedureSelect(e.target.value, newRow.id);
                    }
                });
                newCell.classList.add('medium');
                break;
            case 1:
                newCell.classList.add('large');
                break;
            case 2:
                newCell.classList.add('medium');
                break;
            case 3:
                newCell.classList.add('small');
                newCell.innerHTML = '<button disabled>&#10227;</button>'
                newCell.addEventListener('click', function () {
                    clearRow(newRow);
                })
                break;
            case 4:
                newCell.classList.add('small');
                newCell.innerHTML = '<button>&#128266;</button>';
                newCell.addEventListener('click', function (event) {
                    let isSound = newRow.toggleAttribute('data-sound');
                    if (isSound) {
                        event.target.innerText = '\uD83D\uDD0A';
                    } else {
                        event.target.innerText = '\uD83D\uDD07';
                        snd.pause();
                    }
                })
        }
        newRow.append(newCell);
    }
    if (!isRefresh) {
        statsTableBody.append(newRow);
    }
}


function clearRow(rowElement) {
    rowElement.innerHTML = '';
    delete activePolls[rowElement.id];
    populateTableRows(rowElement, true);


}

function populateWelcomeMessage() {
    connect(window.location.origin + '/user', JSON.stringify({userAgent: navigator.userAgent})).then(function (response) {
        response.json().then(function (parsedResponse) {
            document.getElementById('welcome-message').innerText = `Bienvenido ${parsedResponse.username}`;
            populateTable(parseInt(parsedResponse.allowedRows));
            if (navigator.userAgent.toLowerCase().indexOf('firefox') === -1) {
                popModal('Debido a Limitaciones en la página web de la administración, a veces la recogida de turnos falla en Chrome y algunas versiones de Intenet Explorer.\n\nRecomendamos el uso del navegador Firefox.', 'browserNotice')
            }
        })
    }).catch(function (err) {
        console.error(err);
    })


}

function populateProcedureSelect(provincePath, rowId) {
    let procedureCell = document.querySelector('#' + rowId + ' td:nth-child(2)');
    procedureCell.innerText = 'Obteniendo Datos';
    connect(window.location.origin + '/getProcedures', JSON.stringify({
            'province': provincePath,
            'rowId': rowId
        })
    ).then(function (procedureOptions) {
        procedureOptions.text().then(function (parsedOptions) {
            procedureCell.innerHTML = parsedOptions;
            if (assistant !== null) {
                assistant.stopCurrent();
            }
            procedureCell.firstElementChild.addEventListener('change', function (e) {
                if (assistant !== null) {
                    assistantProcedureHandler();
                }
                if (e.target.value > -1) {

                    let provinceSelect = document.querySelector('#' + rowId + ' td:nth-child(1) select');

                    provinceSelect.parentElement.innerText = provinceSelect.options[provinceSelect.selectedIndex].text
                    let procedureSelect = e.target;
                    let linkAddress = 'https://sede.administracionespublicas.gob.es' + provinceSelect.value.replace('citar', 'acInfo;jsessionid=0') + '&tramite=' + procedureSelect.value;
                    procedureSelect.parentElement.innerHTML = `<a data-href='${linkAddress}' target='_blank'>${procedureSelect.options[procedureSelect.selectedIndex].text}</a>`;
                    document.querySelector('#' + rowId + ' td:nth-child(3)').innerText = 'Inicializando';
                    document.querySelector('#' + rowId + ' td:nth-child(4) button').disabled = false;
                    activePolls[rowId] = {provincePath: provincePath, procedureCode: e.target.value};


                }
            });
        })
    });
}


function startPolling() {
    setInterval(() => {
        if (Object.keys(activePolls).length > 0) {
            connect(window.location.origin + `/pollStatus`, JSON.stringify(activePolls)).then((response) => {
                response.json().then(function (parsedStatus) {
                    updateDashboard(parsedStatus);
                });
            });
        }
    }, pollingInterval)
}

function updateDashboard(rowStatus) {

    for (let rowId in rowStatus) {
        if (rowStatus.hasOwnProperty(rowId)) {

            let areThereOffices = rowStatus[rowId].offices.length > 0;
            let procedureCellLink = document.querySelector('#' + rowId + ' td:nth-child(2) a');
            let statusCell = document.querySelector('#' + rowId + ' td:nth-child(3)');
            let isRowUnmuted = document.getElementById(rowId).hasAttribute('data-sound');

            if (areThereOffices) {
                procedureCellLink.setAttribute('href', procedureCellLink.dataset.href);
                statusCell.innerText = rowStatus[rowId].offices;
                statusCell.style.border = '1px solid green';
                if (isRowUnmuted && snd.paused) {
                    snd.play();
                }
            } else {
                statusCell.innerText = 'En la cola';
                statusCell.style.border = '1px solid red';
                procedureCellLink.removeAttribute('href');
            }

        }
    }
}

function connect(url, body) {
    let init = {
        headers: {
            'Content-Type': 'application/json'
        },
        cache: 'default',
        redirect: 'follow'
    }

    if (body !== null) {
        init.body = body;
        init.method = 'POST';
    } else {
        init.method = 'GET';
    }

    return new Promise(function (resolve, reject) {
        fetch(new Request(url, init)).then(function (response) {
            if (response.redirected) {
                window.location.replace(response.url);
            } else {
                resolve(response);
            }
        }).catch(function (err) {
            reject(err);
            console.error(err);
        })
    })
}

function popModal(msg, type) {

    let modal = document.createElement('div');
    modal.id = 'modal';
    let modalMsg = document.createElement('span');
    modalMsg.classList.add('modalMsg');
    modalMsg.innerText = msg;
    modal.append(modalMsg);
    let lineBreak = document.createElement('br');
    if (type === 'browserNotice') {
        let ffLink = document.createElement('a');
        ffLink.href = 'https://www.mozilla.org/en-GB/firefox/download/thanks/';
        ffLink.id = 'firefoxButton'
        let ffImg = document.createElement('img');
        ffImg.src = '/img/firefox_icon.png';
        ffImg.alt = 'Descarga Firefox';
        ffLink.append(ffImg, lineBreak, 'Pinche aquí para bajarlo');
        modal.append(ffLink);
    }
    let navAides = document.createElement('div');
    navAides.classList.add('navAides');
    let closeModal = document.createElement('button');
    closeModal.id = 'closeModal';
    closeModal.innerText = 'Cerrar'
    navAides.append(closeModal);
    modal.append(navAides);

    document.body.append(modal);
    closeModal.addEventListener('click', function (e) {
        document.body.removeChild(modal);
    })
}

